Fix TemplateProcessor :: fixBrokenMacros; (#1502)

* Fix TemplateProcessor :: fixBrokenMacros;
* add unit test for fixBrokenMacros

Update Language.php

Added Language constants and values for Ukrainian (lines 71, 72):
const UK_UA = 'uk-UA';
const UK_UA_ID = 1058;

table row height rule moved to rowStyle (ivanlanin)
new usage: $table->addRow($height, array("heightRule"=>"exact"));

Signed-off-by: Julien Carignan <julien.carignan@hotmail.com>

Update src/PHPWord/Template.php

This function returns array of all variables in template.
Test code:
$PHPWord = new PHPWord();
$document = $PHPWord->loadTemplate('Template.docx');
var_dump($document->getVariables());
